int
isalpharune(Rune r)
{
	Rune *match;

	if((match = bsearch(&r, alpha3, nelem(alpha3), sizeof *alpha3, &rune2cmp)))
		return !((r - match[0]) % 2);
	if(bsearch(&r, alpha2, nelem(alpha2), sizeof *alpha2, &rune2cmp))
		return 1;
	if(bsearch(&r, alpha1, nelem(alpha1), sizeof *alpha1, &rune1cmp))
		return 1;
	return 0;
}
